import React from "react";
import { Link, Route} from "react-router-dom";
import "./PortfolioNav.css";
import WebProject from "../../pages/WebProject/WebProject";
import Card from "../Card/card";

const PortNav = props => (
  <div>
    <div className="navbar z-depth-3">
      <Link to={`/portfolio`} role="button" id="web11">{props.button1} </Link>{" "}
      <Link to={`/portfolio/fashion`} role="button" id="fashion11"> {props.button2}</Link>{" "}
      <Link to={`/portfolio`} role="button" id="paint11"> {props.button3}</Link>{" "}
    </div>

      <div>
        <Card>
        {/* <WebProject/> */}

          <Route  exact path={`/portfolio/fashion`} component={WebProject} />


        </Card>

      </div>

  </div>
);

export default PortNav;
